import React, { Component } from "react";
import axios from "axios";
import { ListGroup, ListGroupItem } from "reactstrap";
import { Table } from 'reactstrap';

export default class Programs extends Component {
  state = {
    data: {
        alesRequirement: true,
        sgkRequirement: true,
        masterRequirement: true,
        quota: 5,
        _id: "",
        name: "",
        department: "",
        degree: "",
        coordinator: "",
        description: "",
        announceDate: "",
        applicationDeadline: "",
        __v: 0
    },
    datas:[]
  };

  jwtHandler = async () => {
    await axios({
      url: "http://commerchant.herokuapp.com/programs",
      method: "GET",
    })
     .then((response) =>  this.setState({ datas:response.data.payload.programs }))
    .catch(() => console.log("Profil gösterilemedi"));
    this.render()
    this.forceUpdate();
  };



  render() {
    this.jwtHandler()



    return (

      <div>
        <h2> {Programs}</h2>

        <ListGroup>
          {this.state.datas.map((data) => (
            <ListGroupItem

              key={data._id}
            >
              {data.name}
            </ListGroupItem>
          ))}
        </ListGroup>
      </div>
    );
  }
}
